Well, I bet your thinking what is this, ill explain.

Me and my mate Kane at college were discussing games, and we got onto the subject of Pokemon. Anyways he said why dont you do a little Remix of the starting video on the Game Boy game Pokemon Red. I had a think about it and listenened to it, to see if it was doable and decided yeh ill have a go. Well a few days later and this is the result, Enjoy!

